DROP TABLE IF EXISTS park_address;
CREATE TABLE park_address(
   postalCode VARCHAR(10)
  ,city       VARCHAR(35)
  ,stateCode  VARCHAR(2)
  ,line1      VARCHAR(70)
  ,type       VARCHAR(8)
  ,line3      VARCHAR(61)
  ,line2      VARCHAR(62)
  ,uid        INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
);
